import React from 'react';

const Footer = () => {
  return (
    <footer className="flex items-center justify-center w-full py-4 bg-black bg-opacity-90 text-white fixed bottom-0 z-10 shadow-2xl">
      <p className="text-sm font-medium">
        Created by @Payal Pawar
        <span className="mx-2">|</span>
        <a 
          href="https://www.instagram.com/payal_pixelize/" 
          target="_blank" 
          rel="noopener noreferrer" 
          className="text-sm font-medium hover:text-yellow-400"
        >
          Instagram
        </a>
        <span className="mx-2">|</span>
        <a 
          href="https://www.linkedin.com/in/payal-pawar-357243288/?trk=public-profile-join-page" 
          target="_blank" 
          rel="noopener noreferrer" 
          className="text-sm font-medium hover:text-yellow-400"
        >
          LinkedIn
        </a>
      </p>
    </footer>
  );
};

export default Footer;
